sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ...

    var assetArray = [];
    var parsedData = JSON.parse(inputs.response);


    for (var i = 0; i < parsedData.assets.length; i++) {
        var assetObj = {}
        assetObj.name = parsedData.assets[i].name
        assetObj.contract_address = parsedData.assets[i].asset_contract.address;
        assetObj.id = parsedData.assets[i].token_id;
        assetObj.num_sales = parseInt(parsedData.assets[i].num_sales, 10);
        assetObj.image_url = parsedData.assets[i].image_url;
        assetObj.description = parsedData.assets[i].description;
        assetObj.permalink = parsedData.assets[i].permalink;
        assetObj.total_price = parsedData.assets[i].last_sale.total_price;
        try {
            assetObj.current_price = parseFloat(parsedData.assets[i].sell_orders.current_price).toFixed(2);
        } catch (e) {
            gs.addErrorMessage('No price for this NFT found');
            assetObj.current_price = 0;
        }
        try {
            assetObj.creator = parsedData.assets[i].creator.user.username;
        } catch (e) {
            gs.addErrorMessage('No creator info found for this NFT.');
            assetObj.creator = 'User not found.';
        }
        try {
            assetObj.creator_address = parsedData.assets[i].creator.address;

        } catch (e) {
            gs.addErrorMessage('No contract address info found for this NFT.');
            assetObj.creator_address = '';
        }
        try {
            assetObj.creator_profile_pic = parsedData.assets[i].creator.profile_img_url;

        } catch (e) {
            gs.addErrorMessage('No contract address info found for this NFT.');
            assetObj.creator_profile_pic = "";
        }

        assetObj.collection_name = parsedData.assets[i].collection.name;
        assetObj.collection_banner = parsedData.assets[i].collection.banner_image_url;
        assetObj.collection_image = parsedData.assets[i].collection.image_url;
        assetObj.collection_description = parsedData.assets[i].collection.description;
        assetArray[i] = assetObj;
    }
    outputs.assets = assetArray;

})(inputs, outputs);

